package com.iyuba.core.me.pay;import android.text.TextUtils;import org.jetbrains.annotations.NotNull;import java.util.Map;public class PayResultMap {	private String resultStatus;	private String result;	private String memo;	private String extendInfo;	public PayResultMap(Map<String, String> rawResult) {		if (rawResult == null) {			return;		}		for (String key : rawResult.keySet()) {			if (TextUtils.equals(key, "resultStatus")) {				resultStatus = rawResult.get(key);			} else if (TextUtils.equals(key, "result")) {				result = rawResult.get(key);			} else if (TextUtils.equals(key, "memo")) {				memo = rawResult.get(key);			} else if (TextUtils.equals(key, "extendInfo")) {				extendInfo = rawResult.get(key);			}		}	}	@NotNull	@Override	public String toString() {		return "{resultStatus=" + resultStatus				+ ",result=" + result + ""				+ ",memo={" + memo + "}"				+ ",extendInfo={" + extendInfo + "}}";	}	/**	 * @return the resultStatus	 */	public String getResultStatus() {		return resultStatus;	}	/**	 * @return the memo	 */	public String getMemo() {		return memo;	}	/**	 * @return the result	 */	public String getResult() {		return result;	}}